  bindProvinceChange: function (e) {
    var that = this ;
    that.setData({
      "multiIndex[0]": e.detail.value[0],
      "multiIndex[1]": e.detail.value[1]
    });
    var universityId = that.data.universityIdList[that.data.multiIndex[1]];//大学ID
    util.request(api.QueryUniversityById, { universityId: universityId }, 'POST', 'application/x-www-form-urlencoded;charset=utf-8').then(function (res) {
      console.log("res======" + JSON.stringify(res));
      that.setData({
        university: res.data.name
      })
    });
    that.setData({
      universityId: universityId
    });
    util.request(api.QueryUniversityById, {universityId: universityId }, 'POST', 'application/x-www-form-urlencoded;charset=utf-8')
      .then(function (res) {
        // console.log("res=99999999999999999====="+JSON.stringify(res));
        that.setData({
          university: res.data.name,
          college:''
        })
      }); 
    util.request(api.QueryUniversity, { level: 3, parentId: universityId}, 'POST', 'application/x-www-form-urlencoded;charset=utf-8')
      .then(function (res) {
        // console.log("res======"+JSON.stringify(res));
        that.setData({
          collegeArray:res.data
        })
      });
 
  },
  bindUniversityChange: function (e) {
    // console.log("e============"+JSON.stringify(e));
    var that = this;
    switch (e.detail.column) {
      case 0://第一列
        list = [];
        universityIdList = [] ;
        for (var i = 0; i < that.data.objectMultiArray.length; i++) {
          if (that.data.objectMultiArray[i].parid == that.data.objectMultiArray[e.detail.value].regid) {
            list.push(that.data.objectMultiArray[i].regname);
            universityIdList.push(that.data.objectMultiArray[i].regid);
          }
        }
        that.setData({
          "multiArray[1]": list,
          "multiIndex[0]": e.detail.value,
          "multiIndex[1]": 0,
          "universityIdList": universityIdList
        })
    }
  },
