  //上传图片
  chooseImageTap: function () {
    let _this = this;
    wx.showActionSheet({
      itemList: ['从相册中选择', '拍照'],//下面显示的数组是拍照还是别的
      itemColor: "#333",//显示文字的颜色
      success: function (res) {
        if (!res.cancel) {//选中判断
          if (res.tapIndex == 0) {
            _this.chooseWxImage('album')
          } else if (res.tapIndex == 1) {
            _this.chooseWxImage('camera')
          }
        }
      }
    })

  },
  //选择图片进行上传
  chooseWxImage: function (type) {
    var that = this;
    wx.chooseImage({//上传图片事件
      count: 1,//数量
      sizeType: ['original', 'compressed'],//original 原图，compressed 压缩图，默认二者都有
      sourceType: [type], //album 从相册选图，camera 使用相机，默认二者都有
      success: function (res) {
        wx.showLoading({
          title: '上传中'
        }),
       
        wx.uploadFile({
          url: api.UploadImg,//这里是图片上传的接口
          filePath: res.tempFilePaths[0],//这里是选取的图片的地址数组，
          name: 'file',
          header: {
            "Content-Type": "multipart/form-data"
          },
          success: function (res2) {
            wx.hideLoading();
            var jsonObj = JSON.parse(res2.data)
            if (jsonObj.errno == "0"){
              that.setData({
                certificatePic: jsonObj.data
              })
            }else{
              util.showErrorToast(jsonObj.errmsg);
            }
          },
          fail:function(res3){
            wx.hideLoading();
            var jsonObj = JSON.parse(res3.data)
            // console.log("res3=" + res3);
            util.showErrorToast(res3.errmsg);
          }
        });
        
        
      }
    })
  },
  //发送手机验证码
  sendVCode: function () {
    if (!util.checkMobile(this.data.mobile)) {
      return
    }
    util.request(api.SmsCode, { mobile: this.data.mobile }, 'POST', 'application/x-www-form-urlencoded;charset=utf-8')
      .then(function (res) {
        if (res.errno == 0) {
          wx.showToast({
            title: '发送成功',
            icon: 'success',
            duration: 1000
          })
          var pages = getCurrentPages()
          var i = 60;
          var intervalId = setInterval(function () {
            i--
            if (i <= 0) {
              pages[pages.length - 1].setData({
                disableGetMobileCode: false,
                getCodeButtonText: '获取验证码'
              })
              clearInterval(intervalId)
            } else {
              pages[pages.length - 1].setData({
                getCodeButtonText: i,
                disableGetMobileCode: true
              })
            }
          }, 1000);
        } else {
          wx.showToast({
            title: '发送失败',
            icon: 'none',
            duration: 1000
          })
        }
      });

  },
  //表单提交
  updateAuthenInfo: function(e) {
    var that=this;
    if (that.data.certificatePic == '') {
      util.showErrorToast('上传证件照片');
      return false;
    }
    if (that.data.realName == '') {
      util.showErrorToast('请输入姓名');
      return false;
    }
    if (that.data.mobile == '') {
      util.showErrorToast('请输入11位手机号码');
      return false;
    }
    if (that.data.vCode == '') {
      util.showErrorToast('请输入验证码');
      return false;
    }
    if (that.data.universityId == '') {
      util.showErrorToast('请选择学校');
      return false;
    }
    if (that.data.collegeId == '' || that.data.collegeId == '0') {
      util.showErrorToast('请选择学院');
      return false;
    }
    if (that.data.certificateNo == '') {
      util.showErrorToast('请输入证件编号');
      return false;
    }

    wx.showModal({
      title: '温馨提醒',
      content: '请再次确认是否为：' + that.data.university + "。若学校选择错误将无法通过审核！",
      success: function (result) {
        if (result.confirm) {

          let token = wx.getStorageSync('token');
          //重新提交认证信息
          wx.request({
            method: "POST",
            url: api.AuthenUpdate,
            header: {
              'content-type': 'application/x-www-form-urlencoded',
              'X-Nideshop-Token': token
            },
            data: {
              'vCode': that.data.vCode,
              'userType': that.data.userType,
              'certificatePic': that.data.certificatePic,
              'realName': that.data.realName,
              'gender': that.data.gender,
              'universityId': that.data.universityId,
              'collegeId': that.data.collegeId,
              'major': that.data.major,
              'certificateNo': that.data.certificateNo,
              'jobPost': that.data.jobPost,
              'mobile': that.data.mobile
            },
            success: function (res) {
              // console.log("res==="+JSON.stringify(res));
              var errno = res.data.errno;
              if (errno == '0') {
                wx.showToast({
                  title: '提交成功',
                  duration: 2000,
                  success: function (e) {
                    wx.redirectTo({
                      url: '/pages/attestationPageing/attestationPageing'
                    })
                  }
                })
              } else {//提交失败
                if (res.data.errmsg)
                  util.showErrorToast(res.data.errmsg);
                else if (res.data.data)
                  util.showErrorToast(res.data.data);
              }
            }
          })
          //////////////////重新提交认证信息-end
        }
      }
    });

 

  },
