  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function() {
    var that = this;
    util.request(api.QueryAuthenInfo, {}, 'POST', 'application/x-www-form-urlencoded;charset=utf-8')
      .then(function (res) {
        if (res.errno == 0) {
          var major = res.data.major;
          var postIndex = 0 ;
          if (major == '副教授') {
            postIndex = 0
          } else if (major == '教授') {
            postIndex = 1
          } else if (major == '助理教授') {
            postIndex = 2
          } else if (major == '讲师') {
            postIndex = 3
          } else if (major == '院士') {
            postIndex = 4
          }
          
          that.setData({
            userType: res.data.userType,//用户类型
            certificatePic: res.data.certificatePic,//图片地址
            realName: res.data.realName,//真实姓名
            gender: res.data.gender,//性别
            mobile: res.data.mobile,//手机号
            college: res.data.college,//学院名称
            university: res.data.university,//学校ID，默认为清华大学
            collegeId: res.data.collegeId,//学院名称
            universityId: res.data.universityId,//学校ID，默认为清华大学
            certificateNo: res.data.certificateNo,//学号或教职工
            major: res.data.major,//专业
            jobPost: res.data.jobPost,
            refuseReason: res.data.refuseReason,
            index: res.data.userType == '学生' ? 0 : 1,
            indexs: postIndex
          })
        
        } else {
          wx.showToast({
            title: '获取认证信息失败',
            icon: 'none',
            duration: 1000
          })
        }
      });
  },

